import React from "react";
import Form from "./Form";
import styled from "styled-components";

const Wrapper = styled.div`
    background-size: cover;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0;
    margin: 0;
    box-sizing: border-box;
`
const Login = () => {
    return (
        <Wrapper>
          <Form />
        </Wrapper>
    );
} 

export default Login;
